import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';

class LandingLeft extends Component {
    render() {
        return (
            <React.Fragment>
                {
                    this.props.children ?
                        this.props.children
                    :
                        <h4 className="title mb-4">{this.props.title}</h4>
                }
                <p className="text-muted"> {this.props.desc} </p>
                  <a href="/developer-portal-documentation" className="btn btn-primary-outline communitybutton mb-2 mr-2 frakButton">Get Started<i className="mdi mdi-chevron-right"></i></a>



            </React.Fragment>
        );
    }
}

export default LandingLeft;
